el-broccolisoppa-712859/","//www.ica.se/imagevaultfiles/id_79915/cf_259/busenkel_broccolisoppa.jpg","4.2","99","8","lök\npotatis\nbroccoli\ngrönsaksbuljong\nmatlagningsgrädde\nsalt och peppar\nbröd\nkräftstjärt","En riktigt smarrig soppa av broccoli som dessutom är lätt som en plätt att laga till! Servera den varma broccolisoppan tillsammans med en brödbit och njut!")):/^https:\/\/www.ica.se\/recept\/potatis\/sallad\/$/.test(c)?(s.modifyRecipe("toprecipe-1",723665,"Enkel potatissallad","https://www.ica.se/recept/enkel-potatissallad-723665/","//www.ica.se/imagevaultfiles/id_180652/cf_259/enkel_potatissallad.jpg","3.7","3","8","potatis\nsalladslök\nbostongurka\ngräddfil\nmajonnäs\ndijonsenap\nsalt\nsvartpeppar","Sommarens bästa potatissallad? Perfekt för midsommar eller middagen med det där lilla extra. Klassiska ingredienser men nu med adderad dijonsenap vilket ger ett extra sting!"),s.modifyRecipe("toprecipe-2",165198,"Fransk potatissallad","https://www.ica.se/recept/fransk-potatissallad-165198/","//www.ica.se/imagevaultfiles/id_44923/cf_259/fransk_potatissallad.jpg","4.6","38","11","potatis\nschalottenlök\ndill\nkapris\nvinäger\nsenap\nsalt\nsvartpeppar\nsocker\nolivolja\nvatten","Denna fantastiskt goda, franska potatissallad passar utmärkt med det mesta. Sin karaktäristiska, mumsiga smak får potatissalladen när den blandas ihop med den lena senaps- och vinägersåsen. Strö över lite kapris och servera ihop med mört kött."),s.modifyRecipe("toprecipe-3",722108,"Potatissallad med pepparrot och äpple","https://www.ica.se/recept/potatissallad-med-pepparrot-och-apple-722108/","//www.ica.se/imagevaultfiles/id_160299/cf_259/potatissallad_med_pepparrot_och_apple.jpg","5.0","6","12","potatis\nsalladslök\ngräslök\nrädisa\npepparrot\nsaltgurka\näpple\ngräddfil\nmajonnäs\ndijonsenap\nkapris\nsalt och svartpeppar","Äpple, pepparrot, gräslök och skivade rädisor ger din krämiga potatissallad en fräsch krispighet. Perfekt på buffébordet eller att ta med på picknick. Måste testas!")):/^https:\/\/www.ica.se\/recept\/billiga-veckan\/$/.test(c)?(s.modifyRecipe("toprecipe-1",723155,"Pasta med tomatsås och linser","https://www.ica.se/recept/pasta-med-tomatsas-och-linser-723155/","//www.ica.se/imagevaultfiles/id_176291/cf_259/pasta_med_tomatsas_och_linser.jpg","4.6","16","9","morotkrossad tomatkrossad tomat\röd linsspaghettiolivolja\vattensaltpeppar","Pasta är en riktig vardagshjälte när tiden är knapp och familjen är hungrig. Men för att höja näringsvärdet på måltiden är röda linser och morötter två smarta ingredienser att ha i såsen. Detta recept är superenkelt och såsen kan mixas om det passar barnen bättre. Toppa med riven ost."),s.modifyRecipe("toprecipe-2",723146,"Chili con carne med ris","https://www.ica.se/recept/chili-con-carne-med-ris-723146/","//www.ica.se/imagevaultfiles/id_176253/cf_259/chili_con_carne_med_ris.jpg","3.7","18","12","ris\nlök\nkidneyböna\nnötfärs\npastasås\npaprika\nolja\ntomatpuré\npaprikapulver\nvatten\nsalt\npeppar","Med färdig pastasås, en burk kidneybönor och köttfärs har du grunden till en riktigt snabb och enkel chili con carne. Tillsammans med paprika och ris blir måltiden komplett och passar hela familjen. Perfekt att frysa in i matlådor om det blir mat över."),s.modifyRecipe("toprecipe-3",723152,"Kyckling teriyaki med ris och minimajs","https://www.ica.se/recept/kyckling-teriyaki-med-ris-och-minimajs-723152/","//www.ica.se/imagevaultfiles/id_176288/cf_259/kyckling_teriyaki_med_ris_och_minimajs.jpg","4.0","19","7","ris\nkycklingfilé\nminimajs\nteriyakisås\nbabyspenat\nolja\nvatten","Teriyaki kyckling gör du enkelt själv med färdig teriyakisås och kycklingfilé. Slänger du dessutom ner lite söt minimajs i pannan blir barnen extra glada. Servera kycklingen med ris och babyspenat och kanske lite rostade sesamfrön, om du har tid.")):/^https:\/\/www.ica.se\/recept\/lax\/i-ugn\/$/.test(c)?(s.modifyRecipe("toprecipe-1",722771,"Limelax i ugn med chilicrème","https://www.ica.se/recept/limelax-i-ugn-med-chilicreme-722771/","//www.ica.se/imagevaultfiles/id_169738/cf_259/limelax_i_ugn_med_chilicrème_.jpg","4.4","19","19","laxfilé\nolivolja\nlimeskal\nsalt\nsvartpeppar\ncrème fraiche\nlimejuice\nsrirachasås\nsalt\npeppar\nbroccoli\nvitlöksklyfta\nmajskorn\nsmör\nsalt\npeppar\nkoriander\ngurka\ntortillabröd","Lax i ugn ger fin fredagsfeeling med goda tillbehör som smörstekt majs, broccoli och chilicréme. Bjud limelaxen och tillbehören plockigt och låt var och en fylla sitt bröd efter egen smak."),s.modifyRecipe("toprecipe-2",722771,"Ugnsstekt lax med romsås","https://www.ica.se/recept/limelax-i-ugn-med-chilicreme-722771/","//www.ica.se/imagevaultfiles/id_172037/cf_259/ugnsstekt_lax_med_romsas.jpg","4.5","26","7","potatis\nlaxfilé\nsalt\npeppar\ngräddfil\ncaviarmix\nbroccoli","Ugnsstekt lax som tillagas tills den blir underbart mör passar utmärkt ihop med en krämig romsås. Ät fisken tillsammans med nykokt potatis och krispig broccoli och du har en vardagsmiddag som passar hela familjen."),s.modifyRecipe("toprecipe-3",676720,"Saltbakad lax med citronsås - laktosfri","https://www.ica.se/recept/saltbakad-lax-med-citronsas-laktosfri-676720/","//www.ica.se/imagevaultfiles/id_19462/cf_259/saltbakad_lax_med_citronsas_-_laktosfri.jpg","4.6","18","11","lax\nsalt\nlätt crème fraiche\nmatlagningsgrädde\nfiskbuljongtärning\ncitron\nsalt\ngräslök\npotatis\nsockerärta\ncitronklyfta","Denna himmelska, saltbakade lax med smakfull, laktosfri citronsås kommer bli mycket uppskattad på middagsbordet. Koka ihop din härliga sås under tiden laxen tillagas och servera den sedan ihop med pressad potatis, citron och krispiga sockerärter.")):/^https:\/\/www.ica.se\/recept\/rabarber\/paj\/$/.test(c)?(s.modifyRecipe("toprecipe-1",715053,"Knäckig rabarberpaj","https://www.ica.se/recept/knackig-rabarberpaj-715053/","//www.ica.se/imagevaultfiles/id_63250/cf_259/knackig_rabarberpaj.jpg","4.4","205","11","rabarber\nhavregryn\nsocker\nvetemjöl\nbakpulver\nvaniljsocker\nsmör\nvispgrädde\nsirap\nsmör\nvaniljglass","Syrlig rabarber under knäckigt havretäcke med kolasmak. Läckrare rabarberpaj får man leta efter. Servera gärna med vaniljglass."),s.modifyRecipe("toprecipe-2",721996,"Nyttigare rabarberpaj","https://www.ica.se/recept/nyttigare-rabarberpaj-721996/","//www.ica.se/imagevaultfiles/id_161155/cf_259/nyttigare_rabarberpaj.jpg","4.5","8","10","rabarber\njordgubbe\nkardemummakärna\nkokossocker\npotatismjöl\nhavregryn\nhonung\nvaniljsocker\nsmör\nvatten","Klassisk smulpaj med syrliga rabarber och söta jordgubbar. Pajen är sötad med honung och kokossocker. Vi har valt havregryn som tillför nyttiga fibrer istället för vetemjöl och den innehåller mindre smör. Smakar som en sommardag!"),s.modifyRecipe("toprecipe-3",721994,"Rabarberkladdkaka med vit choklad och kardemumma","https://www.ica.se/recept/rabarberkladdkaka-med-vit-choklad-och-kardemumma-721994/","//www.ica.se/imagevaultfiles/id_161146/cf_259/rabarberkladdkaka_med_vit_choklad_och_kardemumma.jpg","3.9","65","10","smör\nvit choklad\nströsocker\nsalt\nägg\nkardemummakärna\nvetemjöl\nrabarber\npotatismjöl\nflorsocker","Smarrig kladdkaka med rabarber, vit choklad och kardemumma. Ett lättlagat och somrigt recept där rabarberns syrliga strävhet balanseras av den söta och mjuka kladdkakan. Här hittar du fler härliga kladdkakerecept.")):/^https:\/\/www.ica.se\/recept\/rabarber\/$/.test(c)?(s.modifyRecipe("toprecipe-1",718995,"Knäckig rabarberpaj med brynt smör","https://www.ica.se/recept/rabarberpaj-med-brynt-smor-718995/","//www.ica.se/imagevaultfiles/id_116224/cf_259/rabarberpaj_med_brynt_smor.jpg","4.3","23","9","rabarber\nsmör\nhavregryn\nströsocker\nvetemjöl\nbakpulver\nsirap\nmjölk\nsalt","Lyxa till rabarberpajen med brynt smör. Det ger en fantastisk nötig touch som passar perfekt till den sötsyrliga fyllningen. En glutenfri variant? Välj ren havre och byt ut vetemjöl mot potatismjöl. Servera pajen ljummen med vaniljglass eller fluffig vaniljsås."),s.modifyRecipe("toprecipe-2",713752,"Len rabarberkräm med kardemumma","https://www.ica.se/recept/len-rabarberkram-med-kardemumma-713752/","//www.ica.se/imagevaultfiles/id_36643/cf_259/len_rabarberkram_med_kardemumma_.jpg","4.1","13","7","vatten\nsocker\nkardemumma\nrabarber\npotatismjöl\nsocker\nmjölk","Recept på en utsökt och somrig efterrätt gjord på rabarber. Rabarberkräm med kardemumma fixar du snabbt av bland annat socker, kardemumma, rabarber och potatismjöl. Servera den lena krämen med mjölk till dessert."),s.modifyRecipe("toprecipe-3",721994,"Rabarberkladdkaka med vit choklad och kardemumma","https://www.ica.se/recept/rabarberkladdkaka-med-vit-choklad-och-kardemumma-721994/","//www.ica.se/imagevaultfiles/id_161146/cf_259/rabarberkladdkaka_med_vit_choklad_och_kardemumma.jpg","3.9","65","10","smör\nvit choklad\nströsocker\nsalt\nägg\nkardemummakärna\nvetemjöl\nrabarber\npotatismjöl\nflorsocker","Smarrig kladdkaka med rabarber, vit choklad och kardemumma. Ett lättlagat och somrigt recept där rabarberns syrliga strävhet balanseras av den söta och mjuka kladdkakan. Här hittar du fler härliga kladdkakerecept.")):/^https:\/\/www.ica.se\/recept\/middag\/$/.test(c)?(s.modifyRecipe("toprecipe-1",679675,"Klassisk lasagne","https://www.ica.se/recept/klassisk-lasagne-679675/","//www.ica.se/imagevaultfiles/id_76171/cf_259/klassisk_lasagne.jpg","4.2","217","17","lök\nvitlöksklyfta\nnötfärs\nolja\ntomatpuré\ntimjan\nrosmarin\nkrossad tomat\nköttbuljongtärning\nsalt och peppar\nlasagneplatta\nmatfett\nvetemjöl\nmjölk\nsalt och peppar\nparmesanost\nsallad","Klassisk lasagne är väl en rätt man aldrig tröttnar på? Med det här receptet blir din lasagne perfekt med en mjuk och härlig konsistens och dessutom har den en ljuv och exemplarisk smak. Parmesanosten är pricken över i!"),s.modifyRecipe("toprecipe-2",716952,"Risotto med skogschampinjoner","https://www.ica.se/recept/risotto-med-skogschampinjoner-716952/","//www.ica.se/imagevaultfiles/id_89399/cf_259/risotto_med_skogschampinjoner.jpg","4.8","106","11","schalottenlök\nvitlöksklyfta\nsvampbuljong\nolivolja\narborioris\nvin\nkastanjechampinjon\nsmör\nparmesanost\nsalt\nruccola","En perfekt kokt risotto är krämig och riset har kvar lite tuggmotstånd. Följ det här grundreceptet på svamprisotto och du har alla chanser att lyckas. Kastanjechampinjonerna i risotton går utmärkt att byta ut mot andra goda svampar som kantareller, karljohansvamp eller portabella till en ännu lyxigare vegetarisk festrätt."),s.modifyRecipe("toprecipe-3",714922,"Foliepaket med torskrygg, sparris, potatis, örter och citron","https://www.ica.se/recept/foliepaket-med-torskrygg-sparris-potatis-orter-och-citron-714922/","//www.ica.se/imagevaultfiles/id_63758/cf_259/foliepaket_med_torskrygg__sparris__potatis__orter_och_citron.jpg","4.8","23","12","färskpotatis\nrödlök\nchili\nrädisa\ngrön sparris\nsmör\nört\ncitron\nflingsalt\npeppar\ngrillfolie\ntorskfilé","Enklaste sättet att grilla är i folie! Gärna primörer med gräslök, persilja, citron, lite chili och smör. Riktigt gott till grillad fisk som torsk eller lax. En sommarfräsch middag till både vardag och fest.")):/^https:\/\/www.ica.se\/recept\/grill\/$/.test(c)?(s.modifyRecipe("toprecipe-1",720557,"Grillad lax i folie","https://www.ica.se/recept/grillad-lax-i-folie-720557/","//www.ica.se/imagevaultfiles/id_138072/cf_259/grillad_lax_i_folie.jpg","4.0","5","5","laxfilé\nfolieark\nsalt och svartpeppar\nsmör\nört","Grillad lax i folie som trängs med härliga kryddor blir verkligen en smaksensation i sig. Lägg till en god sås, härliga tillbehör och en solig eftermiddag och du har garanterat en sommardag att minnas tillbaka till."),s.modifyRecipe("toprecipe-2",720369,"Grillade grönsaksspett med sting","https://www.ica.se/recept/grillade-gronsaksspett-med-sting-720369/","//www.ica.se/imagevaultfiles/id_137108/cf_259/grillade_gronsaksspett_med_sting_____.jpg","3.0","112","9","grillspett\npaprikapulver\nsambal oelek\nolja\nzucchini\nröd paprika\naubergine\nchampinjon\nsalt och svartpeppar","Grillade grönsaksspett piffar upp vilken grilltallrik som helst och med den röda paprikan i fokus blir det en härlig färgklick. I receptet som presenteras nedan oljas grönsakerna in med både parikapulver och sambal oelek, som i sin tur förhöjer smakerna i denna fina grönsaksblandning."),s.modifyRecipe("toprecipe-3",723893,"Karréspett med tahinisås och grillad hjärtsallad","https://www.ica.se/recept/karrespett-med-tahinisas-och-grillad-hjartsallad-723893/","//www.ica.se/imagevaultfiles/id_180838/cf_259/karréspett_med_tahinisas_och_grillad_hjartsallad.jpg","5.0","1","14","kokosmjölk\ningefära\ntahini\nhonung\nlime\nsrirachasås\nsalt\nkarré\npeppar\nhjärtsalladshuvud\nbroccoli\nris\nsesamfrö\nlime","Gör premiär på grillen med dessa saftiga och möra karréspett och grillad hjärtsallad. Den karaktäristiska tahinisåsen som du serverar till, får sin smak från tahini, ingefära, kokosmjölk, lime och sriracha. Lägg upp det grillade på ett stort fat och strö över rostade sesamfrön. Voìla!")):/^https:\/\/www.ica.se\/recept\/cheesecake\/$/.test(c)?(s.modifyRecipe("toprecipe-1",722836,"Cheesecake med oreos","https://www.ica.se/recept/cheesecake-med-oreos-722836/","//www.ica.se/imagevaultfiles/id_169592/cf_259/cheesecake_med_oreos.jpg","4.7","49","7","smör\noreokaka\nägg\nströsocker\nfärskost\nvaniljsocker\nvispgrädde",""),s.modifyRecipe("toprecipe-2",721948,"Klassisk cheesecake","https://www.ica.se/recept/klassisk-cheesecake-721948/","//www.ica.se/imagevaultfiles/id_158770/cf_259/klassisk_cheesecake.jpg","3.5","54","9","färskost\nströsocker\nägg\ncitron\nvetemjöl\ngräddfil\nbär\ndigestivekex\nsmör",""),s.modifyRecipe("toprecipe-3",721427,"Fryst choklad- och hasselnötscheesecake","https://www.ica.se/recept/fryst-choklad-och-hasselnotscheesecake-721427/","//www.ica.se/imagevaultfiles/id_152415/cf_259/fryst_choklad-_och_hasselnotscheesecake.jpg","3.8","42","7","cornflake\nhasselnötskräm\nfärskost\nhasselnötskräm\nchoklad\nvispgrädde\nhasselnöt","")):/^https:\/\/www.ica.se\/recept\/vegetarisk\/$/.test(c)?(s.modifyRecipe("toprecipe-1",718382,"Lasagne med hal